import './scss/styles.scss';
import TopNav from './Components/TopNav';
import { BrowserRouter as Router } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
        </header>
        <TopNav />
      </div>
    </Router>
  );
}

export default App;
